import React, { useEffect, useState } from 'react';

function App() {
    const [signals, setSignals] = useState({});

    useEffect(() => {
        // Fetch stock signals from the backend
        fetch('http://localhost:5001/signals') // Adjust the URL if necessary
            .then(response => response.json())
            .then(data => {
                console.log('Fetched signals:', data); // Log the fetched data
                setSignals(data);
            })
            .catch(error => console.error('Error fetching signals:', error));
    }, []);

    return (
        <div className="App">
            <header>
                <h1>Stock Signal Dashboard</h1>
            </header>
            <main>
                {Object.keys(signals).length > 0 ? (
                    <ul>
                        {Object.entries(signals).map(([stock, signal], index) => (
                            <li key={index}>
                                <strong>{stock}</strong>: {signal}
                            </li>
                        ))}
                    </ul>
                ) : (
                    <p>Loading signals...</p>
                )}
            </main>
        </div>
    );
}

export default App;
